@EU_Commission Not enough! Rescue the refugees, clear the concentration camps in Greece, give them access to water, soap, individual housing!

Do it now!

#LeaveNoOneBehind

@EU_Commission Unfortunately, there are divisions.
Rich and poor, workers and entrepreneurs...
The system cannot give any solution without entering in contradiction with itself. The only #solution is a #revolution. May the EU become the new #communist league

@EU_Commission A Mini state with a population of 24 Mio must help the „big“ Eu with a population of 440 Mio.
Everyone sees now you useless Brussels are.
We need to put all decisions back to the national countries. Even Finland was fully prepared!

@EU_Commission I believe that #EU money for #COVID__19 crisis health support is once again being misused. Reports from eastern #Europe state that leading politicians are placing PPE orders with dubious suppliers with NO history of this supply market.
Once again EU funding corruption
#EUexit now
